def Rsafactor(d: int, e: int, n: int) -> list:
    if d <= 0 or e <= 0 or n <= 1:
        raise ValueError("Precondition failed: d > 0, e > 0, n > 1 required.")
    # Compute k = d*e - 1
    k = d * e - 1
    if k % 2 == 1:
        # If k is odd, cannot proceed (should not happen for valid RSA params)
        raise ValueError("Cannot factor n with these parameters (k must be even).")
    # Factor k as 2^t * r
    t = 0
    r = k
    while r % 2 == 0:
        r //= 2
        t += 1
    # Try small random values for g
    for g in range(2, min(n, 100)):
        x = pow(g, r, n)
        if x == 1 or x == n - 1:
            continue
        for i in range(t):
            y = pow(x, 2, n)
            if y == 1:
                p = gcd(x - 1, n)
                if p != 1 and p != n:
                    q = n // p
                    return [p, q]
            if y == n - 1:
                break
            x = y
    # If not found, fallback to trial division (for small n)
    for p in range(2, int(n ** 0.5) + 1):
        if n % p == 0:
            q = n // p
            return [p, q]
    # If all fails, return n as a trivial factorization
    return [n, 1]

def gcd(a, b):
    while b:
        a, b = b, a % b
    return abs(a)
